Because we previously had some non-unified parameters sent to the triggers, we had to, in each action of each controller, follow a pattern like:

```js
function action (request, context) {
    var modifiedRequest;
  
    return kuzzle.pluginsManager.trigger('beforeEvent', {request, context})
        .then(r => {
            modifiedRequest = r;
  
            return doSomething(modifiedRequest);
        }
        .then(response => {
            return kuzzle.pluginsManager.trigger('afterEvent', new ResponseObject(modifiedRequest, response));
        });
}
```

This pattern is quite heavy.
Now that we agreed on unifying the arguments sent to the trigger, we can directly delegate it to the funnel.

